import React from "react";
import "../styles/Panel.css";
import { useNavigate } from "react-router-dom";

function EmployeeList() {
    const navigate = useNavigate();
    const git = (page) => {
        navigate('/employee/${page}')
    }

    return (
        <div className="panel-container">
            <div className="panel-left">
                <h2>Employee List</h2>
                <form>
                    <button onClick={() => git("employeeList")}>EmployeeList</button>
                    <button onClick={() => git("productList")}>ProductList</button>
                    <button onClick={() => git("orders")}>Orders</button>
                    <button onClick={() => git("salesReport")}>Sales Report</button>
                    <button type="button" onClick={() => navigate("/manager/panel")}>Back to Manager Panel</button>
                </form>
            </div>
        </div>
    );
}

export default EmployeeList;
